  name: "RTKLib POS"
  code: "rtklib"
  file-type: ColumnsFixedWidth
  match-regex: "^.*RTKPOST-QT ver.+ Emlid b33$"
  file-format:
    has-header: false
    comment-prefix: '%'
    decimal-separator: '.'
    column-lengths: [23, 15, 15, 11, 4, 4, 9, 9, 9, 9, 9, 9, 7]
  columns:     
    latitude:
      index: 1
    longitude:
      index: 2
    date-time:
      index: 0